import { useStyles } from './Styles';
import { Grid } from '@mui/material';
import { Box } from '@mui/material';

const LetterNews = () => {
    // const classes=useStyles();
    return (
        <Grid container item xs={12}>
            <Grid style={{ width: "100%", height: "150px", margin: "auto" }}>
                <Box style={{ border: "1px solid gray", borderRadius: "20px", height: "100px", width: "80%", margin: "auto" }}>
                    <div style={{display}}>
                        <div>
                            <h5>Newsletter Sign Up</h5>
                            <p>
                                Newsletter Sign USign up and stay updated on the latest in interior
                                decor, events & Discounts & offers
                            </p>
                        </div>
                        <div></div>
                    </div>
                </Box>

            </Grid>
        </Grid>
    );
};

export default LetterNews;
